import { GET_QUIZZES} from '../actionType.js'
import axios from "axios"


export const getQuizzes = ()=>{
    return (dispatch)=>{
        axios.get("/api/quizzes/all").then((res)=>{
            console.log('res', res)
            dispatch({
                type: GET_QUIZZES,
                payload: res.data,
            })
        })

    }
}
